import React from "react";
import Header from './Header';
import Footer from './Footer';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function Container(){
    return (
    <Router>
        <Header />
        <Routes>
            <Route
            path="/"
            element={<About />}
            />
            <Route
            path="/resume"
            element={<Resume />}
            />
            <Route
            path="/contact"
            element={<Contact />}
            />
            <Route
            path="/portfolio"
            element={<Portfolio />}
            />
        </Routes>
        <Footer />
    </Router>
)}
export default Container;
